"original": |2-
     INUSE
        An operation has not been carried out because it involves sawing
        off a branch someone else is sitting on.  Someone else may be
        holding an exclusive lock needed for this operation, or the
        operation may involve deleting a resource someone else is using,
        typically a mailbox.
"fixed": |-
  INUSE  -  An operation has not been carried out because it involves sawing off a branch someone else is sitting on.  Someone else may be holding an exclusive lock needed for this operation, or the operation may involve deleting a resource someone else is using, typically a mailbox.
"ko": |-
  INUSE - 다른 사람이 앉아 있는 가지를 톱질하는 작업이 포함되어 있어 작업이 수행되지 않았습니다.  다른 사람이 이 작업에 필요한 단독 잠금을 보유하고 있을 수도 있고, 다른 사람이 사용하고 있는 리소스(일반적으로 사서함)를 삭제하는 작업이 포함될 수도 있습니다.
